			{ id: 2, message: 'It\'s my first post', likesCount: 12 }
		] */

	// let postsElements = posts.map(p => <Post message={p.message} likesCount={p.likesCount} />)

	return (
		<div className={s.postsBlock}>
			<h3>
				My posts
			</h3>
			<div>
				<div>
					<textarea></textarea>
				</div>
				<div>
					<button>Add post</button>
				</div>
			</div>
			<div className={s.posts}>
				{props.posts}
				{/* {postsElements} */}
			</div>
		</div>
	);
};

